import './App.css';
import Header from './components/Header';
import styled from 'styled-components';

const AppContainer = styled.div`
	width: 100vw;
	height: 100vw;
	background-image: linear-gradient(90deg, #002F52 35%, #326589);

	li {
	list-style: none;
	}
`
function App() {
  return (
		<AppContainer className='App'>
			<Header />
    </AppContainer>
  );
}

export default App
